        private void InitPermutations()
        {
            mListPermutations = new List<Permutation>();

            for (int idx1 = 0; idx1 < 7; idx1++) {
                for (int idx2 = 0; idx2 < 7; idx2++)
                {
                    for (int idx3 = 0; idx3 < 7; idx3++) {
                        for (int idx4 = 0; idx4 < 7; idx4++)
                        {
                            if (idx1 < idx2 && idx1 < idx3 && idx1 < idx4 && idx2 < idx3 && idx2 < idx4 && idx3 < idx4) {
                                mListPermutations.Add(new Permutation(idx1, idx2, idx3, idx4));
                            }
                        }
                    }
                }
            }
        }

        private void SetProgress(string progress)
        {
